import React from 'react'
import { createNativeStackNavigator } from '@react-navigation/native-stack';

import ActiveHunt from './ActiveHunt';
import CreateHunt from './CreateHunt';
import FindHunts from './FindHunts';
import HuntInfo from './HuntInfo';
import Hunts from './Hunts';
import MyHunts from './MyHunts';



const Stack = createNativeStackNavigator();

const HuntStack = () => {
    return (
        <Stack.Navigator initialRouteName='Hunts'>
          <Stack.Screen 
            name='ActiveHunt'
            component={ActiveHunt}
          />
          <Stack.Screen 
            name='CreateHunt'
            component={CreateHunt}
          />
          <Stack.Screen 
            name='FindHunt'
            component={FindHunts}
          />
          <Stack.Screen 
            name='HuntInfo'
            component={HuntInfo}
          />
          <Stack.Screen 
            name='Hunts'
            component={Hunts}
          />
          <Stack.Screen 
            name='MyHunts'
            component={MyHunts}
          />
        </Stack.Navigator>
    );
}

export default HuntStack
